\"    | \"Hawk\"       | \"777\"  | \"78905643\" | \"madre selva\" | \"san salvador\" | \"san salvador\" |\r\n\r\n  @website-member-direct-ui @WebsiteCoverage @AP_Club%20LM @AG_MemberDirect @Club%20LM @Generic&Checkout @TEST_TS-1146 @express\r\n  Scenario Outline: [CypressCoverage][website-member-direct-ui] Change new credit card for a suscription\r\n    Given a member logged in navigates to plan administration\r\n    When have a banner that indicates that have suspend account for non-payment\r\n    Then access in the tab Manage your plan the section of manage is displayed for \"<plan_name>\"\r\n    And in the section of Payment method select Use new credit card\r\n    And check both checkboxes\r\n    And click Change credit card\r\n    Then redirect to checkout page showing the \"<monthly_price>\"\r\n    When complete the card information <cc_number><cc_first_name><cc_last_name><cc_cvv><cc_phone><cc_address><cc_state><cc_city>\r\n    Then click in the button for pay\r\n    Then redirect to page confirmation when the information of payment method change for \"<plan_name>\"\"<monthly_miles>\"\r\n\r\n    Examples:\r\n      | plan_name | monthly_price | monthly_miles | cc_number          | cc_first_name | cc_last_name | cc_cvv | cc_phone   | cc_address      | cc_state       | cc_city        |\r\n      | Plan Lite | US$ 20.00     | LM 500        | \"4532510296496885\" | \"Farnese\"     | \"Vandimion\"  | \"777\"  | \"78905649\" | \"san sebastian\" | \"san salvador\" | \"san salvador\" |\r\n\r\n  @website-member-direct-ui @WebsiteCoverage @AP_Club%20LM @AG_MemberDirect @Club%20LM @TEST_TS-1149 @express\r\n  Scenario Outline: [CypressCoverage][website-member-direct-ui] Change save credit card for a suscription\r\n    Given a member logged in navigates to plan administration\r\n    When access in the tab Manage your plan the section of manage is displayed for \"<plan_name>\"\r\n    And have a banner that indicates that have suspend account for non-payment\r\n    And in the section of Payment method select the saved credit card\r\n    And complete the CVV number\r\n    And check both checkboxes\r\n    And click Change credit card\r\n    Then see a confirmation modal that indicate the change of credit card\r\n    When click in the button Close\r\n    Then don't have a banner that indicates that have suspend account for non-payment\r\n\r\n    Examples:\r\n      | plan_name |\r\n      | Plan Lite |\r\n\r\n  @website-member-direct-ui @WebsiteCoverage @AP_Club%20LM @AG_MemberDirect @Club%20LM @TEST_TS-1144 @express\r\n  Scenario Outline: [CypressCoverage][website-member-direct-ui] Change plan for a subscription\r\n    Given a member logged in navigates to landing page\r\n    When access in the tab Manage your plan the section of manage is displayed for \"<plan_name>\"\r\n    And click the button Change plan corresponding to the \"<plan_name>\" that you have susbcribe\r\n    Then see a popup that show the four plans available for \"<club_type>\"\r\n    And the radio button that corresponding to plan subscribe is selected\r\n    And the button Continue is disable\r\n    When change the radio button selected to other plan\r\n    Then the button Continue is enable\r\n    When click the button Continue\r\n    Then see a popup the show that indicates the change to the \"<new_plan_name>\" and the date to starting\r\n    When click the button Change plan\r\n    Then see a confirmation modal that indicate the change of plan\r\n    When click the button Close\r\n    And redirect to plan administration page\r\n    Then the button Change Plan corresponding to the \"<plan_name>\" appear disable\r\n    And the others buttons \"Subscribe\" of the other plans appear disable\r\n\r\n    Examples:\r\n      | plan_name | new_plan_name |\r\n      | Plan Lite | Plan Basic    |\r\n\r\n  @website-member-direct-ui @WebsiteCoverage @AP_Club%20LM @AG_MemberDirect @Club%20LM @TEST_TS-1147 @express\r\n  Scenario Outline: [CypressCoverage][website-member-direct-ui] Manual cancelation for a suscription\r\n    Given a member logged in navigates to landing page\r\n    Then access in the tab Manage your plan the section of manage is displayed for \"<plan_name>\"\r\n    When meet the minimun permanency of \"<months>\"\r\n    Then the button Cancel subscription apper enable\r\n    When click the button Cancel subscription\r\n    Then see a popup for confirm the cancelation\r\n    When click the button Yes, cancel\r\n    Then see a popup with the confirmation of cancelation of \"<plan_name>\"\r\n    When redirect to the subscription page\r\n    Then alls the buttons of four plans appear enable\r\n\r\n    Examples:\r\n      | plan_name | months |\r\n      | Plan Lite | 6      |\r\n\r\n# @website-member-direct-ui @WebsiteCoverage @AP_Club%20LM @AG_MemberDirect @Club%20LM @NA @TEST_TS-1148  @PRUEBA\r\n# Scenario Outline: [CypressCoverage][website-member-direct-ui] Automatic cancelation for a suscription\r\n#  Given have a susbcription for \"<plan_name>\"\r\n#  When the payment recurrence failed for all retries configured\r\n#  Then the susbcription is canceled automatically\r\n\r\n#  Examples:\r\n#    | plan_name  |\r\n#    | Individual |\r\n\r\n# @website-member-direct-ui @WebsiteCoverage @AP_Club%20LM @AG_MemberDirect @Club%20LM @NA @TEST_TS-1145\r\n# Scenario Outline: [CypressCoverage][website-member-direct-ui] Monthly recurrence for a suscription\r\n#  Given have a susbcription for \"<plan_name>\"\r\n#  When the payment recurrence occurs\r\n#  Then the susbcription is charged for a new month\r\n\r\n#  Examples:\r\n#    | plan_name  |\r\n#    | Individual |\r\n","uri":"cypress\\e2e\\clubLM.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[],"location":{"line":3,"column":1},"language":"en","keyword":"Feature","name":"Club LM scenarios","description":"","children":[{"scenario":{"id":"2a1ce52a-ae49-4527-8f06-2f191f48cc0b","tags":[{"location":{"line":5,"column":3},"name":"@website-member-direct-u
